import React from 'react';
import {Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar/Navbar';
import Home from './pages/home/home';

const App = () => {
  return (
    <Routes>
        <Route path="/" element={<Home/>} />
    </Routes>
  );
};

export default App;
